const Home = () => {
  return (
    <div>
      <h1>Bem-vindo à Semana Acadêmica</h1>
      <p>Esta é a página inicial do nosso site.</p>
      <button className="btn">Clique aqui</button>
    </div>
  )
}

export default Home
